// @lc code=start
const MAX_BUCKET_COUNT = 100;

/**
 * 插入排序
 * @param {number[]} nums 待排序数组
 * @returns {number[]} 排序后的数组
 */
const insertionSort = nums => {
    if (!Array.isArray(nums)) { return nums; }
    const sorted = [nums.shift()];
    nums.forEach(item => {
        let target = 0;
        for (let index = sorted.length - 1; index >= 0; index--) {
            if (sorted[index] > item) {
                sorted[index + 1] = sorted[index];
                continue;
            }
            target = index + 1;
            break;
        };
        return sorted[target] = item;
    });
    return sorted;
}

/**
 * 桶排序
 * @param {number[]} nums 待排序数组
 * @returns {number[]} 排序后的数组
 */
const bucketSort = nums => {
    const { length } = nums
    if (!Array.isArray(nums) || length < 2) { return nums; }
    const bucketCount = typeof MAX_BUCKET_COUNT !== 'undefined' ?
        Math.min(length, MAX_BUCKET_COUNT)
        :
        length;
    const min = Math.min(...nums);
    const max = Math.max(...nums);
    const bucketSize = (max - min) / bucketCount || 1;
    const bucket = Array(bucketCount);
    nums.forEach(num => {
        if (Number.isNaN(+num)) { return; }
        const index = Math.floor((num - min) / bucketSize);
        if (!bucket[index]) {
            bucket[index] = [];
        }
        bucket[index].push?.(num);
    });
    return bucket.map(array => insertionSort(array))
        .reduce((previous, next) => previous?.concat(next));
};

/**
 * @param {number[]} nums
 * @return {number}
 */
var maximumGap = function(nums) {
    const sortedNums = bucketSort(nums) ?? [];
    // return sortedNums.reduce((previousDiff, current, index) => {
    //     // console.log({index})
    //     const diff = sortedNums[index + 1] - current;
    //     return Math.max(diff, previousDiff);
    // }, 0);
    let maxDiff = 0;
    for (let index = 0, { length } = sortedNums; index < length - 1; index++) {
        const diff = sortedNums[index + 1] - sortedNums[index];
        if (diff <= maxDiff) { continue; }
        maxDiff = diff;
    }
    return maxDiff;
};
